import React from "react";
import { NavLink } from "react-router-dom";
import styled from "styled-components";

const Navbar = () => {

  const Nav = styled.nav`
    display: flex;
    align-items: center;
    justify-content:space-between;
  .navbar{
    display: flex;
    align-items: center;
    gap: 2rem;
    .navbar_list{
text-decoration:none;
list-style:none;

      .navbar_link{
        display: flex;
    align-items: center;
    justify-content:space-between;
    gap:3rem
    color: red;
      }
    }
  }

  `;
  return (
    <>
      <Nav>
        <div className="navbar">
          <ul className="navbar_list">
            <li>
              <NavLink className="navbar_link" to="/home">Home</NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/about">About</NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/contact">Contact</NavLink>
            </li>

            <li>
              <NavLink className="navbar_link" to="/services">Services</NavLink>
            </li>
          </ul>
        </div>
      </Nav>
    </>
  );
};

export default Navbar;
